import { Paper, Box, Typography, TextField, Button, Container } from "@mui/material";

const LoginPage = () => {
    const[credentials,setCredent]=useState({email:"",password:""})
      const handleChange = (e) => {
        setLogin({ ...credentials, [e.target.name]: e.target.value });
    };
  return (
    <Container>
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      flexGrow={1} 
      py={10}
    >
      <Paper
        elevation={3}
        sx={{
          p: 4,
          width: 350,
          display: "flex",
          flexDirection: "column",
          gap: 2,
        }}
      >
        <Typography variant="h5" textAlign="center">
          Login
        </Typography>
        <TextField label="Email" name='email' onChange={handleChange} variant="outlined" fullWidth />
        <TextField label="Password" name='password' type="password" onChange={handleChange} variant="outlined" fullWidth />
        <Button variant="contained" fullWidth>
          Login
        </Button>
      </Paper>
    </Box>
    </Container>
  );
};

export default LoginPage;
